import React from "react";

const Card = ({ name, imageUrl, height, weight }) => {
  return (
    <div className="card">
      <img src={imageUrl} alt={name} />
      <div className="card-details">
        <h2>{name}</h2>
        <p>Altura: {height} m</p>
        <p>Peso: {weight} kg</p>
      </div>
    </div>
  );
};

export default Card;
